import React, { useEffect, useState, useRef } from "react";
import { PrivateAxios } from "../../environment/AxiosInstance";
import moment from "moment-timezone";
import { ErrorMessage, SuccessMessage } from "../../environment/ToastMessage";
import { SlideshowLightbox } from "lightbox.js-react";
import "lightbox.js-react/dist/index.css";
import SignatureCanvasComponent from "./SignatureCanvas";
import SettingsPageTopBar from "./SettingsPageTopBar";
function CompanyInfo() {
  const timezones = moment.tz.names();
  const defaultTimezone = moment.tz.guess();
  const [selectedTimezone, setSelectedTimezone] = useState(defaultTimezone);
  const [currentTime, setCurrentTime] = useState(
    moment().tz(defaultTimezone).format("YYYY-MM-DD HH:mm:ss")
  );
  const [companyAddress, setCompanyAddress] = useState("");
  const [deliveryAddress, setDeliveryAddress] = useState("");
  const [selectedTemplate, setSelectedTemplate] = useState("template1");
  const [signature, setSignature] = useState("");
  const [signatureexisting, setSignatureexisting] = useState("");
  const sigCanvasRef = useRef();
  useEffect(() => {
    const updateTime = () => {
      setCurrentTime(
        moment().tz(selectedTimezone).format("YYYY-MM-DD HH:mm:ss")
      );
    };

    const intervalId = setInterval(updateTime, 1000);

    return () => clearInterval(intervalId);
  }, [selectedTimezone]);

  const handleTimezoneChange = (event) => {
    setSelectedTimezone(event.target.value);
  };

  const getTimezoneOffsetString = (timezone) => {
    const offset = moment.tz(timezone).utcOffset();
    const hours = Math.floor(offset / 60);
    const minutes = offset % 60;
    const sign = hours >= 0 ? "+" : "-";
    return ` ${timezone} (GMT${sign}${String(Math.abs(hours)).padStart(
      2,
      "0"
    )}:${String(Math.abs(minutes)).padStart(2, "0")})`;
  };

  const sortedTimezones = timezones.sort((a, b) => {
    const offsetA = moment.tz(a).utcOffset();
    const offsetB = moment.tz(b).utcOffset();
    return offsetA - offsetB;
  });
  // currency
  const currencies = [
    { code: "USD", name: "United States Dollar", symbol: "$" },
    { code: "EUR", name: "Euro", symbol: "€" },
    { code: "JPY", name: "Japanese Yen", symbol: "¥" },
    { code: "GBP", name: "British Pound Sterling", symbol: "£" },
    { code: "AUD", name: "Australian Dollar", symbol: "A$" },
    { code: "CAD", name: "Canadian Dollar", symbol: "C$" },
    { code: "CHF", name: "Swiss Franc", symbol: "CHF" },
    { code: "CNY", name: "Chinese Yuan", symbol: "¥" },
    { code: "SEK", name: "Swedish Krona", symbol: "kr" },
    { code: "NZD", name: "New Zealand Dollar", symbol: "NZ$" },
    { code: "MXN", name: "Mexican Peso", symbol: "MX$" },
    { code: "SGD", name: "Singapore Dollar", symbol: "S$" },
    { code: "HKD", name: "Hong Kong Dollar", symbol: "HK$" },
    { code: "NOK", name: "Norwegian Krone", symbol: "kr" },
    { code: "KRW", name: "South Korean Won", symbol: "₩" },
    { code: "TRY", name: "Turkish Lira", symbol: "₺" },
    { code: "RUB", name: "Russian Ruble", symbol: "₽" },
    { code: "INR", name: "Indian Rupee", symbol: "₹" },
    { code: "BRL", name: "Brazilian Real", symbol: "R$" },
    { code: "ZAR", name: "South African Rand", symbol: "R" },
    { code: "THB", name: "Thai Baht", symbol: "฿" },
    { code: "MYR", name: "Malaysian Ringgit", symbol: "RM" },
    { code: "IDR", name: "Indonesian Rupiah", symbol: "Rp" },
    { code: "PHP", name: "Philippine Peso", symbol: "₱" },
    { code: "PLN", name: "Polish Zloty", symbol: "zł" },
    { code: "AED", name: "United Arab Emirates Dirham", symbol: "د.إ" },
    { code: "VND", name: "Vietnamese Dong", symbol: "₫" },
    { code: "EGP", name: "Egyptian Pound", symbol: "£" },
    { code: "SAR", name: "Saudi Riyal", symbol: "﷼" },
    { code: "NGN", name: "Nigerian Naira", symbol: "₦" },
    // Add more currencies as needed
  ];

  const [selectedCurrency, setSelectedCurrency] = useState(currencies[0]);

  const handleCurrencyChange = (event) => {
    const selectedCode = event.target.value;
    const currency = currencies.find((c) => c.code === selectedCode) || {
      code: "",
      name: "",
      symbol: "",
    };
    setSelectedCurrency(currency);
  };
  const handleCompanyAddressChange = (event) => {
    setCompanyAddress(event.target.value);
  };

  const handleDeliveryAddressChange = (event) => {
    setDeliveryAddress(event.target.value);
  };
  const handleTemplateChange = (event) => {
    setSelectedTemplate(event.target.value);
  };
  const fetchSettings = async () => {
    try {
      const response = await PrivateAxios.get("general_settings");
      const settings = response.data.data;
      console.log(settings);

      if (settings) {
        setSelectedTimezone(settings.timezone || defaultTimezone);
        setSelectedCurrency(
          settings.currency || { code: "", name: "", symbol: "" }
        );
        setCompanyAddress(settings.companyAddress || "");
        setDeliveryAddress(settings.deliveryAddress || "");
        setSelectedTemplate(settings.template || "template1");
        setSignatureexisting(settings.signature || "");
      }
    } catch (error) {
      console.error("Error fetching settings:", error);
    }
  };
  useEffect(() => {
    fetchSettings();
  }, []);

  const handleSignatureChange = (sig) => {
    setSignature(sig);
    console.log("Captured Signature:", sig); // Debug log to ensure signature is captured
  };
  const submit = async (e) => {
    e.preventDefault();
    const data = {
      currency: selectedCurrency,
      timezone: selectedTimezone,
      companyAddress,
      deliveryAddress,
      template: selectedTemplate,
      signature, // Include the signature
    };
    console.log(data);

    try {
      const response = await PrivateAxios.post("general_settings", data);
      if (response.status === 200) {
        SuccessMessage("Settings updated successfully");
        fetchSettings();

      } else {
        ErrorMessage("Api Error please try after some time");
      }
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <>
      <SettingsPageTopBar />
      <div id="fms_list_section" className="p-4">
        <div className="row">
          <div className="col-12">
            <div className="card">
              <form onSubmit={submit}>
                <div className="card-header">
                  <h3 className="card-title">General Settings</h3>
                </div>
                <div className="card-body">
                  <div class="row">
                    <div class="col-md-6 col-sm-12 mb-6">
                      <div className="form-group">
                        <label for="planned_date" className="form-label">
                          Select Timezone: <span class="text-danger">*</span>
                        </label>
                        <select
                          id="timezone"
                          className="form-control"
                          value={selectedTimezone}
                          onChange={handleTimezoneChange}
                        >
                          {sortedTimezones.map((timezone) => (
                            <option key={timezone} value={timezone}>
                              {getTimezoneOffsetString(timezone)}
                            </option>
                          ))}
                        </select>
                      </div>
                    </div>
                    <div class="col-md-6 col-sm-12 mb-6">
                      <div className="form-group">
                        <label for="planned_date" className="form-label">
                          Select Default Currency:{" "}
                          <span class="text-danger">*</span>
                        </label>
                        <select
                          className="form-control"
                          id="currency"
                          value={selectedCurrency.code}
                          onChange={handleCurrencyChange}
                        >
                          {currencies.map((currency) => (
                            <option key={currency.code} value={currency.code}>
                              {currency.symbol} - {currency.name}
                            </option>
                          ))}
                        </select>
                      </div>
                    </div>
                  </div>
                  <div class="row ">
                    <div className="col-12 mb-3">
                      <div className="border px-3 pt-3 rounded-4">
                        <div className="row">
                          <div class="col-12 ">
                            <h6 class="text-dark fw-bold">Purchase</h6>
                          </div>
                          <div className="col-md-6 col-sm-12 mb-6">
                            <div className="form-group">
                              <label htmlFor="companyAddress" className="form-label">
                                Company Address: <span className="text-danger">*</span>
                              </label>
                              <textarea
                                rows={7}
                                className="form-control"
                                name="companyaddress"
                                value={companyAddress}
                                onChange={handleCompanyAddressChange}
                              ></textarea>
                            </div>
                          </div>
                          <div className="col-md-6 col-sm-12 mb-6">
                            <div className="form-group">
                              <label htmlFor="deliveryAddress" className="form-label">
                                Delivery Address: <span className="text-danger">*</span>
                              </label>
                              <textarea
                                rows={7}
                                className="form-control"
                                name="deliveryaddress"
                                value={deliveryAddress}
                                onChange={handleDeliveryAddressChange}
                              ></textarea>
                            </div>
                          </div>
                        </div>
                      </div>
                    </div>
                    <div className="col-12 mb-3">
                      <div className="border px-3 pt-3 rounded-4">
                     
                        <h6 class="text-dark fw-bold">Choose your template</h6>
                        <div className="d-flex gap-3 flex-wrap mt-3">
                          <label className="custom-radio me-3 mb-2">
                            <input
                              type="radio"
                              name="template"
                              value="template1"
                              checked={selectedTemplate === "template1"}
                              onChange={handleTemplateChange}
                            />
                            <span className="checkmark" />
                            <span className="template-image">
                              <SlideshowLightbox className="image-expand">
                                <img
                                  src="data:image/png;base64,"
                                  alt=""
                                />
                              </SlideshowLightbox>
                            </span>
                          </label>
                          <label className="custom-radio me-3 mb-2">
                            <input
                              type="radio"
                              name="template"
                              value="template2"
                              checked={selectedTemplate === "template2"}
                              onChange={handleTemplateChange}
                            />
                            <span className="checkmark" />
                            <span className="template-image">
                              <SlideshowLightbox className="image-expand">
                                <img
                                  src="data:image/png;base64,"
                                  alt=""
                                />
                              </SlideshowLightbox>
                            </span>
                          </label>
                          <label className="custom-radio me-3 mb-2">
                            <input
                              type="radio"
                              name="template"
                              value="template3"
                              checked={selectedTemplate === "template3"}
                              onChange={handleTemplateChange}
                            />
                            <span className="checkmark" />
                            <span className="template-image">
                              <SlideshowLightbox className="image-expand">
                                <img
                                  src="data:image/png;base64,"
                                  alt=""
                                />
                              </SlideshowLightbox>
                            </span>
                          </label>
                          <label className="custom-radio me-3 mb-2">
                            <input
                              type="radio"
                              name="template"
                              value="template4"
                              checked={selectedTemplate === "template4"}
                              onChange={handleTemplateChange}
                            />
                            <span className="checkmark" />
                            <span className="template-image">
                              <SlideshowLightbox className="image-expand">
                                <img
                                  src="data:image/png;base64,"
                                  alt=""
                                />
                              </SlideshowLightbox>
                            </span>
                          </label>
                        </div>
                      </div>
                    </div>
                    <div className="col-12">
                    <div className="border p-3 rounded-4">
                      <div className="row">
                        <div className="col-md-6 col-sm-12 mb-6">
                          <h6 class="text-dark fw-normal mb-2">Digital Signature</h6>
                          <div className="">
                            <SignatureCanvasComponent
                              onSignatureChange={handleSignatureChange}
                            />
                          </div>
                        </div>
                        <div className="col-md-6 col-sm-12 mb-6">
                          <h6 class="text-dark fw-normal mb-2">Digital Signature</h6>
                          <div className="w-100">
                          <p>Existing</p>
                            <img src={signatureexisting} alt="" />
                          </div>
                        </div>
                      </div>
                      </div>
                    </div>
                  </div>
                </div>
                <div className="card-footer d-flex justify-content-end">
                  <button
                    type="submit"
                    className="btn btn btn-success ">Save</button>
                   
                
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default CompanyInfo;
